import React from 'react';
import './Welcome.css'; // Importing CSS for styling

const Welcome = () => {
  return (
    <div className="foodhub-container">
      <div className="foodhub-header">
        <button className="skip-button">Skip</button>
      </div>
      <div className="foodhub-content">
        <h1>Welcome to <span className="foodhub-brand">FoodHub</span></h1>
        <p>Your favourite foods delivered fast at your door.</p>
        <div className="foodhub-signin">
          <button className="signin-button facebook">FACEBOOK</button>
          <button className="signin-button google">GOOGLE</button>
          <button className="signin-button email">Start with email or phone</button>
        </div>
        <p className="already-account">
          Already have an account? <a href="#">Sign In</a>
        </p>
      </div>
    </div>
  );
};

export default Welcome;
